Vulnerability it’s a powerful thing. When we accept the things that make us vulnerable we are able to truly embrace all that we are and live more aligned with our true selfs. 

I never had an approval, so all my live I was looking for it in others. Lately I stoped, I understood that all approval that I need is in me, and as long as I’m good with my decisions nothing and no one matters. I stoped being busy all the time, I startet to relax and enjoy quiet time. That’s maybe weird but this is my vulnerable thing, that is my vulnerable place in me but finally I don’t feel bad talking about it, it’s just my thing, and all is have something like thin in us, embrace it, fell good with it and it will go away. Just like with every emotion.. if you want to let it go, talk about it and then let it go.. it will go away and take all bad things wit it. 

Season 2020 I can call regeneration, but I startet to fell hunger.. hunger for some trail ultra.. some plans that I was hoping to make in this year hopefully I’ll realise in 21 but I’m hungry for some adventures! Another step closer.. weekend vibes ON! #ChargeON 

